import React, { useEffect, useState } from "react";

import axios from "axios";

import {
  TableContainer,
  Table,
  TableHead,
  TableBody,
  TableRow,
  TableCell,
  Paper,
} from "@mui/material";

interface User {
  id: Number;
  firstName: String;
  lastName: String;
  jobTitle: String;
  afm: String;
  salary: Number;
}

function Home() {
  const [users, setUsers] = useState<Array<User>>([]);

  useEffect(() => {
    loadEmployees();
  }, []);

  const loadEmployees = async () => {
    const employees = await axios.get("http://localhost:8080/employee/getAll");
    setUsers(employees.data);
  };

  return (
    <TableContainer
      component={Paper}
      style={{ margin: "auto", width: "80%", marginTop: "35px" }}
      sx={{ maxHeight: "300px" }}
    >
      <Table arial-aria-label="simple table" stickyHeader>
        <TableHead>
          <TableRow>
            <TableCell>Id</TableCell>
            <TableCell>First Name</TableCell>
            <TableCell>Last Name</TableCell>
            <TableCell>Job Title</TableCell>
            <TableCell>TIN</TableCell>
            <TableCell>Salary (in â‚¬)</TableCell>

            <TableCell align="center">Actions</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {users.map((user, userIndex) => (
            <TableRow
              key={userIndex}
              sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
            >
              <TableCell>{String(user.id)}</TableCell>
              <TableCell>{user.firstName}</TableCell>
              <TableCell>{user.lastName}</TableCell>
              <TableCell>{user.jobTitle}</TableCell>
              <TableCell>{user.afm}</TableCell>
              <TableCell align="center">{String(user.salary)}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}

export default Home;
